import "./App.css";
import ImageSlider from "./components/ImageSlider";
import { SliderData } from "./components/SliderData";
import background from "./images/van_gogh_blossoms.jpeg";

function App() {
  return (
    <div className="App" style={{ backgroundImage: `url($)`}}>
      <header className="App-header">
        <img src={background} alt="logo" />
        <p className="Title">
          {" "}
          You may ask why should Barbara go on a date with me. Use the arrow
          keys to right or left to know more about.
        </p>
        <ImageSlider slides={SliderData} />;
      </header>
    </div>
  );
}

export default App;
